import React from "react";
import { weekdays, months } from "../../../Global/Constants";

export default function Post({ data }) {
  return (
    <div style={{ border: "1px solid grey", margin: "10px 0", padding: 10 }}>
      <div style={{ color: "grey" }}>
        {weekdays[data.date.weekday]}, {data.date.day} {months[data.date.month]}
      </div>
      <div style={{ fontSize: "20px" }}>{data.content}</div>
    </div>
  );
}
